const keyMapAr = [[0,'name'],[1,'lat'],[2,'lon'],[3,'id'],[4,'state'],[5,'network'],[6,'elevation'],[7,'mysterious letters'],[8,'mysterious number'],[9,'HUC'],[10,'zero'],[11,'first empty array'],[12,'second empty array']]
const returnKeyAr = ['name', 'lat', 'lon', 'id', 'state', 'network', 'elevation', 'HUC']
const bbObj = {
  latMin: 31.034108,
  latMax:43.929550,
  lonMin: -116.696777,
  lonMax: -105.117188
}
const StationInfoFactory = (stationDataAr, keyMapAr, returnKeyAr) =>{
  const keyMap = new Map(keyMapAr)
  const stationInfoObject = Object.create({})
  stationDataAr.map((currData, i)=>{
    const currKey = keyMap.get(i)
    if(returnKeyAr.indexOf(currKey) >=0){
      stationInfoObject[currKey] = currData
    }
  })
  return stationInfoObject
}

const FullStationDataFactory = (dataAr, bbObj, keyMapArray, returnKeyAr, stationInfoFactory) =>{
  function getAllStationMetadata(){
    return dataAr.filter(currEntry => {
      const lat = currEntry[1]
      const lon = currEntry[2]
      return lat >= bbObj.latMin && lat <= bbObj.latMax && lon>=bbObj.lonMin && lon <= bbObj.lonMax
    }).map(currEntry=> StationInfoFactory(currEntry, keyMapArray, returnKeyAr))
  }
  function getStationIds(idType = 'id'){
    if(idType === 'triplet'){
      return getAllStationMetadata().map(currInfo => `${currInfo.id}:${currInfo.state}:${currInfo.network}`)

    }
    else{
      return getAllStationMetadata().map(currInfo => currInfo.id)
    }
  }
  function metadataById(){
    const metadataByIdObject = Object.create({})
    getAllStationMetadata().map(currInfo =>{
      const {id, ...rest} = currInfo
      metadataByIdObject[id] = {...rest}
    })
    return metadataByIdObject
  }

  async function getStationNormals(type='average'){
    if(type!=='median' && type!== 'average'){
      throw new Error(`${type} is not a valid type`)
    }
    const stationIds = getStationIds('triplet')
    const avgUrl = 'https://www.nrcs.usda.gov/Internet/WCIS/data/SRVO/MONTHLY/PERIODAVG/SRVO_MONTHLY_PERIODAVG_ALL.json?_=1648593498216'
    const medianUrl = 'https://www.nrcs.usda.gov/Internet/WCIS/data/SRVO/MONTHLY/PERIODMED/SRVO_MONTHLY_PERIODMED_ALL.json?_=1648593498217'
    const requestUrl = type === 'average' ? avgUrl : medianUrl
    const normalData = await axios.get(requestUrl)
    const areaNormalObject = Object.create({})
    if(!normalData || !normalData.data){
      throw new Error(`no data return drom ${requestUrl}, ${normalData}`)
      
    }
    const normalDataObject = Object.create({})
    for (const [stationKey, stationData] of Object.entries(normalData.data)){
      normalDataObject[stationKey]={statType:type}
      for(const [period, data] of Object.entries(stationData)){
      normalDataObject[stationKey][period]=data

      }
    }
    stationIds.map(curr=>{
      if(normalDataObject[curr]){
        const stationId = curr.split(":")[0]
        areaNormalObject[stationId] = normalDataObject[curr]
      }
    })
    try{
      fs.writeFileSync(`./nrcsClimoData/${type}.json`,JSON.stringify(areaNormalObject))
    }
    catch(e){
      console.log('error saving to local json', e)
    }
  }
  return {getAllStationMetadata, getStationIds, metadataById, getStationNormals}
}

